import React from 'react';

const HeaderAdmin = () => {
    return (
        <div className="w-[1440px] h-16 relative bg-white rounded-b-[14px]">
            <div className="w-[72px] h-[21px] left-[288px] top-[26px] absolute">
                <div
                    className="left-[28px] top-[1px] absolute text-neutral-400 text-sm font-normal font-['Roboto'] leading-tight tracking-wide">Поиск
                </div>
                <div className="w-5 h-5 left-0 top-0 absolute"/>
            </div>
            <div className="w-6 h-6 left-[1393px] top-[18px] absolute">
                <div className="w-2 h-2 left-[13px] top-[2px] absolute bg-rose-500 rounded-full border border-white"/>
            </div>
            <div className="w-10 h-10 left-[24px] top-[12px] absolute">
                <img className="w-[60px] h-10 left-[-10px] top-0 absolute" src="https://via.placeholder.com/60x40"/>
            </div>
            <div className="w-6 h-6 left-[232px] top-[24px] absolute"/>
            <div
                className="w-32 h-[26px] left-[80px] top-[24px] absolute text-black/opacity-90 text-xl font-medium font-['Roboto'] leading-[30px] tracking-tight">Димон
                Д.
            </div>
        </div>
    );
};

export default HeaderAdmin;
